package 반복문;

public class ForExam4 {

	public static void main(String[] args) {
			// TODO Auto-generated method stub
			for(int i=1;i<=6;i++) {       //6줄   
				for(int j=1; j<=5; j++) {     //5칸
					System.out.print(j);  //5까지 숫자  
				} //inner for  
				System.out.print("\n"); 
		} //outer for 
	}

}
